package com.vitamincode.vitamincode_be.service.impl;import com.vitamincode.vitamincode_be.entity.Students;import com.vitamincode.vitamincode_be.mapper.StudentsMapper;import com.vitamincode.vitamincode_be.service.StudentsService;import lombok.RequiredArgsConstructor;import org.springframework.stereotype.Service;import java.util.List;@Service@RequiredArgsConstructorpublic class StudentsServiceImpl implements StudentsService {    private final StudentsMapper studentsMapper;    @Override    public List<Students> findAllStudents() {        if (!studentsMapper.findAllStudents().isEmpty()) {            return studentsMapper.findAllStudents();        }        return null;    }    @Override    public Students findStudentById(Integer studentId) {        if (!studentsMapper.findAllStudents().isEmpty()) {            return studentsMapper.findStudentById(studentId);        }        return null;    }}